import logo from './logo.svg';
import './App.css';
import { Button, Input } from '@mui/material';
import { Spacing, Stack } from '@mui/system';
import { useState } from 'react';


function App() {
  const [show, setShow] = useState(false);

  return (
    <div className="App">
      <Stack spacing={1}>
        <div>
      <Button variant="contained" sx={{ m: 8 }} onClick={() => setShow(prev => !prev)}>Add</Button>
      <Button variant="contained">Sample 10</Button>
      </div>
      {show && <Input placeholder='Write the number you want to add here'/>}
      </Stack>
    </div>
  );
}

export default App;
